// RUN: mlir-clang++ %s | FileCheck %s

#include <iostream>

class Vec {
    public:
double x, y;
    Vec() : x(), y() {}
    Vec(int q) {}
    Vec(double x, double y) : x(x), y(y) {

    }
    Vec operator+(Vec z) {
        return Vec(x+z.x, y+z.y);
    }
};

int main() {
    Vec a;
    Vec b(2, 4);
    Vec d(4);
    Vec c = a + b + d;
    std::cout << "x: " << c.x << " y: " << c.y << "\n";
}

